import React, { useEffect, useState } from "react";
import { useLocation } from "react-router-dom";
import axios from "axios";
import { GoogleMap, LoadScript, Marker } from "@react-google-maps/api";
import { GoogleLogin, useGoogleLogin } from "@react-oauth/google";
import "../styles/DoctorSearch.css";

const API_URL = "http://localhost:5008";

const SearchResults = () => {
    const location = useLocation();
    const searchParams = location.state || {};
    const [query, setQuery] = useState(searchParams.query || "");
    const [city, setCity] = useState(searchParams.location || "İzmir");
    const [user, setUser] = useState(
        JSON.parse(localStorage.getItem("doctorInfo")) || 
        JSON.parse(localStorage.getItem("patientInfo")) ||
        JSON.parse(localStorage.getItem("userInfo")) // Google Sign-In
    );

    const [doctors, setDoctors] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState("");
    const [suggestions, setSuggestions] = useState([]);
    const [pendingAppointment, setPendingAppointment] = useState(null);

    useEffect(() => {
        const fetchDoctors = async () => {
            try {
                const response = await axios.get(`${API_URL}/api/doctors/search?q=${query}&location=${city}`);
                if (response.data.doctors.length === 0) {
                    setError("Sonuç bulunamadı.");
                } else {
                    setDoctors(response.data.doctors);
                }
            } catch (error) {
                console.error("Error fetching doctors:", error);
                setError("Doktorları yüklerken bir hata oluştu.");
            } finally {
                setLoading(false);
            }
        };

        if (query.length >= 2) fetchDoctors();
    }, [query, city]);

    useEffect(() => {
        if (query.length < 2) {
            setSuggestions([]);
            return;
        }

        const fetchSuggestions = async () => {
            try {
                const response = await axios.get(`${API_URL}/api/doctors/autocomplete?q=${query}`);
                setSuggestions(response.data);
            } catch (error) {
                console.error("Error fetching autocomplete:", error);
            }
        };

        const debounce = setTimeout(fetchSuggestions, 300);
        return () => clearTimeout(debounce);
    }, [query]);

    const handleSelectSuggestion = (suggestion) => {
        setQuery(suggestion);
        setSuggestions([]);
    };

    const getCurrentWeekTimes = (availableTimes) => {
        const today = new Date();
        const endOfWeek = new Date();
        endOfWeek.setDate(today.getDate() + 6);

        return availableTimes.filter(time => {
            const timeDate = new Date(time.date);
            return timeDate >= today && timeDate <= endOfWeek;
        });
    };

    const handleBookAppointment = (doctor, time) => {
        if (!user) {
            // If user is not logged in, save pending appointment
            setPendingAppointment({ doctor, time });
            return;
        }

        alert(`Randevu alındı: ${doctor.full_name} - ${time.time}`);
        // Call API to book appointment (backend needed)
    };

    // Handle Google Login
    const googleLogin = useGoogleLogin({
        onSuccess: (response) => {
            axios.get("https://www.googleapis.com/oauth2/v3/userinfo", {
                headers: { Authorization: `Bearer ${response.access_token}` }
            }).then((res) => {
                const userInfo = {
                    full_name: res.data.name,
                    email: res.data.email,
                    profile_picture: res.data.picture
                };
                localStorage.setItem("userInfo", JSON.stringify(userInfo));
                setUser(userInfo);

                // If there was a pending appointment, complete it now
                if (pendingAppointment) {
                    handleBookAppointment(pendingAppointment.doctor, pendingAppointment.time);
                    setPendingAppointment(null);
                }
            });
        },
        onError: () => {
            alert("Google giriş başarısız oldu.");
        }
    });

    return (
        <div className="results-container">
            <div className="results-header">
                <h3>Doktor Ara</h3>
                {user ? (
                    <p>Giriş yapan: {user.full_name}</p>
                ) : (
                    <button onClick={() => googleLogin()} className="google-login-btn">
                        Google ile Giriş Yap
                    </button>
                )}
                <p>Herhangi bir ek ücret ödemeden randevu alın.</p>

                <input
                    type="text"
                    placeholder="Doktor adı veya uzmanlık alanı"
                    value={query}
                    onChange={(e) => setQuery(e.target.value)}
                    className="search-input"
                />
                {suggestions.length > 0 && (
                    <ul className="autocomplete-list">
                        {suggestions.map((item, index) => (
                            <li key={index} onClick={() => handleSelectSuggestion(item.full_name)}>
                                {item.full_name} - {item.specialization}
                            </li>
                        ))}
                    </ul>
                )}
            </div>

            {loading ? (
                <p>Yükleniyor...</p>
            ) : error ? (
                <p>{error}</p>
            ) : (
                doctors.map((doctor) => (
                    <div key={doctor.id} className="doctor-card">
                        <div className="doctor-info">
                            <img src={doctor.image || "/default-doctor.jpg"} alt={doctor.full_name} className="doctor-image"/>
                            <div>
                                <h4>{doctor.full_name} ✅</h4>
                                <p>{doctor.specialization}</p>
                                <p>{doctor.city}</p>
                                <p>⭐ {doctor.reviews || 0} Görüş</p>
                            </div>
                        </div>
                        <div className="appointment-times">
                            {getCurrentWeekTimes(doctor.availableTimes).map((time, index) => (
                                <button 
                                    key={index} 
                                    className="appointment-button"
                                    onClick={() => handleBookAppointment(doctor, time)}
                                >
                                    {time.time}
                                </button>
                            ))}
                        </div>
                    </div>
                ))
            )}

            <div className="map-container">
                <LoadScript googleMapsApiKey="YOUR_GOOGLE_MAPS_API_KEY">
                    <GoogleMap
                        mapContainerClassName="google-map"
                        center={{ lat: 38.4192, lng: 27.1287 }}
                        zoom={12}
                    >
                        {doctors.map((doctor) => (
                            <Marker key={doctor.id} position={{ lat: doctor.lat, lng: doctor.lng }} />
                        ))}
                    </GoogleMap>
                </LoadScript>
            </div>
        </div>
    );
};

export default SearchResults;
